"use strict";

Component({
  props: {
    className: '',
    style: '',
    leftText: '',
    rightText: '',
    leftIconType: '',
    rightIconType: '',
    leftClassName: '',
    rightClassName: '',
    onLeft: null,
    onRight: null
  },
  methods: {
    onLeft: function onLeft(e) {
      this.props.onLeft && this.props.onLeft(e);
    },
    onRight: function onRight(e) {
      this.props.onRight && this.props.onRight(e);
    }
  }
});